class Solution(object):
    def lengthOfLIS(self, nums):
        """
        :type nums: List[int]
        :rtype: int
        """
        if not nums:
            return 0
        n = len(nums)
        up_count = [1] * n
        for i in range(n):
            if i > 0 and nums[i] == nums[i-1]:
                continue
            self.slave(i, nums, up_count)
        return max(up_count)

    def slave(self, n, nums, up_count):
        for i in range(n):
            if nums[n] > nums[i]:
                up_count[n] = max(up_count[n], up_count[i] + 1)


